import React from 'react';
import Card from "./Card"

class CardList extends React.Component{
    render(){
        return(
            <div>
                {
                    this.props.robots2.map((user,i)=>{
                        <div> <Card id={user[i].id} name={user[i].name} email={user[i].email} />  </div>
                    })
                }
            </div>
        )
    }
}
export default CardList
